import React, { Component } from 'react';
import Header from './components/Header';
import Options from './components/Options';

class App extends Component {
    constructor(props) {
        super(props);



        this.state = {
            options: []
        }
    }


    render() {
        return (
            <div>
                <Header title="Indecision App"/>
                <Options options={this.state.options}/>
            </div>
        );
    }
}

export default App;
